import React from 'react';
import styled from "styled-components";

const UiComponentsStyles = () => {
  return (
    <Container>
      <H1>UI components & styles</H1>
      <H3>INPUTS</H3>
      <div className='app'>
        <form action=""><h3 className='default'>default</h3>
        <h5>email</h5>
        <input type="text" name='email' placeholder='' />
        <input type="text" name='password' placeholder='Forgot your password'/>
        </form>
        <form action=""><h3>active</h3>
        <h4>email</h4>
        <input type="text" name='email' placeholder='anastasi' />
        <h4>password</h4>
        <input type="text" name='password' placeholder='**********'/>
        </form>
      </div>
    </Container>
  )
}

const Container = styled.div`
  background: #E5E5E5;
  position: absolute;
  top: 0;
  left: 0;
  bottom: 0;
  right: 0;

`
const H1 = styled.div`
position: absolute;
width: 848px;
height: 24px;

font-family: 'Montserrat';
font-style: normal;
font-weight: 600;
font-size: 70px;
line-height: 24px;
/* identical to box height, or 34% */

text-align: center;

color: #000000;
`

const H3 = styled.div`
height: 28px;
width: 148px;
left: -1387px;
top: -295px;
border-radius: nullpx;

`

.default = styled.div`
height: 28px;
width: 84px;
left: -1387px;
top: -217px;
border-radius: nullpx;

`

export default UiComponentsStyles
